import React from "react";
import classes from "./MealItem.module.css";

const MealItem = (props) => {
  const price = `$ ${props.price}`;
  return (
    <li>
      <div>
        <h3>{props.name}</h3>
        <div>{props.desc}</div>
      </div>
      <div>{price}</div>
    </li>
  );
};
export default MealItem;
